acteristics in the filter'=>'Товар должен обладать всем свойствами выбранными в фильтре','The product must have at least one of the selected characteristics in the filter'=>'Товар должен обладать одним из выбранных свойств в фильтре','The status can be assigned by the administrator after sending an invoice to the client for payment.'=>'Статус может быть назначен администратором после отправки клиенту счета на оплату.','The status is assigned to orders that cannot be satisfied (for example, the product is not in stock). Later, at any time you can change the status of the order (for example, if the product is in stock);'=>'Статус присваивается заказам, которые не могут быть удовлетворены (например, товара нет на складе). Позже в любой момент вы можете изменить статус заказа (например, если товар есть в наличии);','The status is assigned to orders transferred to the courier. An order can maintain this status for a long time, depending on how far the customer is located;'=>'Статус присваивается заказам, переданным курьеру. Заказ может поддерживать этот статус в течение длительного времени, в зависимости от того, как далеко находится клиент;','The status is assigned to the order automatically if the settlement is made through the Money Online payment system. If the goods were delivered by courier and paid in cash, the status can be used as a reporting;'=>'Статус присваивается заказу автоматически, если расчет производится через платежную систему Money Online. Если товар был доставлен курьером и оплачен наличными, статус можно использовать в качестве отчетности;','The status that is assigned to a new order'=>'Этот статус присваивается новому заказу','There was an error sending a letter to the site administrator!'=>'Возникла ошибка при отправке письма администратору сайта!','This checkbox is needed if you will not store templates in the "f-shop" directory of your theme.'=>'Этот флажок необходим, если Вы не будете хранить шаблоны в каталоге «f-shop» вашей темы.','This checkbox should be noted if you intend to process events triggered by the plugin yourself'=>'Этот флажок следует отметить, если вы собираетесь самостоятельно обрабатывать события, запускаемые плагином','This determines the order in which products are displayed on the site. By default, Wordpress sorts by ID.'=>'Это определяет порядок, в котором продукты отображаются на сайте. По умолчанию Wordpress сортирует по ID.','This field is required'=>'Это поле обязательное','this field is required'=>'это поле обязательное','This field is required.'=>'Это поле обязательное.','This is a fixed amount or a percentage discount?'=>'Это фиксированная скидка или процентная?','This is convenient in some cases, but it is better to leave this option off'=>'Эта опция иногда необходима, но лучше оставить её выключенной','This is the main price on the site. Required field!'=>'Это главная цена на сайте. Поле обязательное!','This message is sent to the buyer at the time the manager confirms the order. You can use meta data of type: <code>%order_id%</code> - order number, <code>%pay_name%</code> - name of the payment method, <code>%pay_url%</code> - payment reference .'=>'Это сообщение будет отправлено покупателю если менеджер магазина подтвердил заказ. Вы можете использовать эти метаданные в письме: <code>%order_id%</code> - номер заказа, <code>%pay_name%</code> - название метода оплаты, <code>%pay_url%</code> - ссылка для оплаты .','This message will be shown if the buyer has successfully paid the order. You can use these variables: <code>%order_id%</code> - order number, <code>%pay_name%</code> - name of the payment method'=>'Это сообщение будет показано на сайте в случае успешной оплаты. Вы можете использовать следующие переменные: <code>%order_id%</code> - номер заказа, <code>%pay_name%</code> - название выбранного метода оплаты','This parameter configures the number of products that will be displayed on the catalog page or product category'=>'Этот параметр устанавливает количество товаров которые будут показаны на странице каталога и категории товаров','This status is assigned to an order if violations were detected on the part of the customer. On subsequent orders, all orders from this IP, e-mail, phone automatically receive this status.'=>'Этот статус присваивается заказу, если выявлены нарушения со стороны заказчика. При последующих заказах все заказы с этого IP, электронной почты, телефона автоматически получают этот статус.','This tab is relevant if you have several varieties of a single product.'=>'Этот таб необходим в том случае если Вы продаете несколько разновидностей одного и того же товара.','This type changes the base price displayed by default.'=>'Этот тип изменяет базовую цену, отображаемую по умолчанию.','This user does not exist on the site'=>'Такой пользователь не найден на этом сайте','Three-digit currency code'=>'Код валюты, три символа (например: USD)','Thumbnail'=>'Миниатюра','Title'=>'Название','Title in the order letter to the administrator'=>'Заголовок в письме оформления заказа отправляемого администратору','Title in the order letter to the buyer'=>'Заголовок в письме оформления заказа отправляемого покупателю','To catalog'=>'В каталог','To personal account'=>'В личный кабинет','To the catalog'=>'В каталог','To wish list'=>'В список желаний','Total'=>'Всего','Total Cost'=>'Общая стоимость','Total cost'=>'Общая стоимость','Total discount on products as a percentage'=>'Общая скидка на все товары в процентах','Turn off the appearance of the basket'=>'Выключить отображение корзины','Type'=>'Тип','Type of delivery'=>'Способ доставки','Type of payment'=>'Метод оплаты','Ukrainian'=>'Украинский','Ukrainian hryvnia'=>'Украинская гривна','Unavailable for payment'=>'Не доступен для оплаты','Unfortunately, a user with such data does not exist on the site'=>'К сожалению пользователя с таким данными не существует на сайте','units'=>'единицы','Up-sell products'=>'Апселл товары','Update Date'=>'Дата обновления','US dollar'=>'Доллар США','Use a penny?'=>'Использовать копейки?','Use the number of purchased goods to compare with this attribute.'=>'Использовать количество товаров в корзине для сравнения с этим атрибутом.','Used when placing the order, if the user is authorized'=>'Используется при оформлении заказа, если пользователь авторизован','User "%s" added a comment. <a href="%s" target="_blank"> Go to comment <a>'=>'Пользовательr "%s" добавил комментарий. <a href="%s" target="_blank"> К комментарию <a>','User "%s" changed order status to "%s"'=>'Пользователь "%s" изменил статус заказа на "%s"','User "%s" created an order'=>'Пользователь "%s" создал заказ','User %s requests to be notified of the availability of the product "%s". Product Link: %s'=>'Пользователь %s просит уведомить его о наличии товара "%s". Ссылка на товар: %s','User data is not filled in or not valid!'=>'Данные пользователя не заполнены или не прошли проверку!','User is not found'=>'Пользователь не найден','Validation failed'=>'Проверка не пройдена','Value'=>'Значение','Variant'=>'Вариант','Variant name'=>'Название варианта','Variation'=>'Вариации','Vendor code'=>'Артикул','View order'=>'Смотреть заказ','Viewed products list has been cleared'=>'Просмотренные товары были удалены','Views'=>'Просмотрено','Virtual'=>'Виртуальный','Virtual Product'=>'Виртуальный товар','Vitaliy Karakushan'=>'Виталий Каракушан','Welcome back, %s! You have successfully logged in.'=>'С возвращением, %s! Вы успешно вошли в систему.','What type of basket to show'=>'Какой тип корзины показывать','When adding a product to the cart which is not available, the buyer will be shown a window asking for contact information'=>'Если покупатель попытается добавить в корзину товар которого нет в наличии, то ему будет показано окно запроса контактных данных','When choosing this method, send the buyer immediately to the payment page'=>'Если выбран этот метод оплаты, то покупатель будет автоматически переадресован на странцу оплаты, без подтвеждения заказа.','When choosing this option, the cost of packaging will also be added to the order value.'=>'Если выбрать эту опцию то к стоимости товаров в корзине будет добавлена стоимость упаковки','Wish list is empty'=>'Список желаний пустой','Wish List Page'=>'Страница списка желаний','WishList'=>'Список желаний','Wishlist'=>'Список желаний','Yes'=>'Да','You are already logged in'=>'Вы уже авторизованы','You are already logged in.'=>'Вы уже вошли на сайт','You are already logged in. <a href="%1$s">Logout</a>. <a href="%2$s">Go to cabinet</a>'=>'Вы уже авторизованы. <a href="%1$s">Выйти</a>. <a href="%2$s">В кабинет</a>','You can drag images to change positions in the gallery.'=>'Вы можете перетаскивать изображения для изменения позиции в галерее','You can enter a fixed cost or as a percentage, for example "5%"'=>'Вы можете ввести фиксированную стоимость или в процентах, например "5%"','You can specify multiple recipients separated by commas.'=>'Вы можете указать несколько получателей разделив их запятой.','You currently have no orders'=>'В текущее время у вас нет заказов','You currently have no orders.'=>'В текущее время у вас нет заказов','You have already voted for this review!'=>'Вы уже проголосовали за этот отзыв!','You have selected all available items from stock.'=>'Вы выбрали все доступные товары со склада.','You must accept the terms and conditions'=>'Вы должны принять положения и условия','Your basket is empty'=>'Ваша корзина пуста','Your basket is empty. <a href="%s">To catalog</a>'=>'Ваша корзина пуста. <a href="%s">В каталог</a>','Your data has been successfully changed'=>'Ваши данные успешно изменены','Your data has been successfully updated.'=>'Ваши данные успешно обновлены.','Your data has been updated successfully!'=>'Ваши данные успешно обновлены!','Your data has not been changed, or you did not specify it.'=>'Ваши данные не были изменены или Вы не указали их.','Your email'=>'Ваш e-mail','Your like has been added to the review!'=>'Ваш лайк добавлен к отзыву!','Your name'=>'Ваше имя','Your order #%d has been placed. We will contact you shortly.'=>'Ваш заказ #%d размещен. Мы свяжемся с вами в ближайшее время.','Your order #%order_id% has been successfully approved. The next stage is payment of the order. You can pay for the purchase by <a href="%pay_url%">link</a>. You have chosen the payment method: %pay_name%.
